#include <stdlib.h>
#include <stdio.h>
#include <time.h>


#define N_LEN 300   //250
#define G_LEN 5
int main(){
     srand(time(NULL));

    int N[N_LEN];
    int N_c[N_LEN];
    int N_Base[N_LEN];
    int G[G_LEN] = {1, 0, 1, 1, 1};
    
    // Заполнение массива данных 
    for(int i = 0; i<N_LEN-G_LEN+1; i++){
        N[i] = rand() % 2;
        N_c[i] = N[i];
        N_Base[i] = N[i];
    }
    // Добавление нулей в конец
    for(int i = N_LEN-G_LEN+1; i < N_LEN; i++) N[i] = 0;
    
    // Вывод N
    for(int i=0; i < N_LEN; i++) printf("%d", N[i]);
    printf(" <- N\n");
    
    // Вычисление XOR и остатка от деления
    for(int i=0; i < N_LEN-G_LEN+1; i++){
        if(N[i] == 1){
            for(int j=0; j < G_LEN; j++) 
            N[i+j] ^= G[j];
        }
    }
    //Вывод остатка при отправке
    for(int i=N_LEN-G_LEN+1; i < N_LEN; i++) printf("%d", N[i]);
    printf(" <- CRC \n\n");

    // Добавление остатка
    for(int i=N_LEN-G_LEN+1; i < N_LEN; i++){
    N_c[i] = N[i];
    N_Base[i] = N[i];
    }
    //Вывод N при получении
    for(int i=0; i < N_LEN; i++) printf("%d", N_c[i]);
    printf(" <- N_c\n");

     // опять подсчет XOR и остатка от деления    
    for(int i=0; i < N_LEN-G_LEN+1; i++){
            if(N_c[i] == 1){
                for(int j=0; j < G_LEN; j++)
                N_c[i+j] ^= G[j];
            }
    }

    for(int i=N_LEN-G_LEN+1; i < N_LEN; i++) printf("%d", N_c[i]);
    printf(" <- CRC\n\n");



    // Искажение
    int total_k = 0;
    float sred_error = 0;
    float count_err = 0;
    for(int len_n = 100; len_n < 2000; len_n += 50){
        int kk=0;
        for(int package = 0; package < 50; package++){
            int No[len_n];
            int No_c[len_n];
            for(int i = 0; i<len_n-G_LEN+1; i++){
                No[i] = rand() % 2;
                No_c[i] = No[i];
                // N_Base[i] = N[i];
            }
            // Добавление нулей в конец
            for(int i = len_n-G_LEN+1; i < len_n; i++) No[i] = 0;
            // for(int i = 0; i < len_n; i++) printf("%d", No[i]);
            // printf("\n");
            // Вычисление XOR и остатка от деления
            for(int i=0; i < len_n-G_LEN+1; i++){
                if(No[i] == 1){
                    for(int j=0; j < G_LEN; j++) 
                    No[i+j] ^= G[j];
                 }
            }
            // Добавление остатка
            for(int i=len_n-G_LEN+1; i < len_n; i++){
            No_c[i] = No[i];
            }
            // for(int i = 0; i < len_n; i++) printf("%d", No_c[i]);
            // printf("^^\n");
            int k=0;
            // Получился готовый массив No_c вместе с CRC
            for(int o = 0; o<len_n; o++){
                int No_cc[len_n];
                for(int i = 0; i<len_n; i++)
                    No_cc[i] = No_c[i];
                // Искажение битов по очереди
                if (No_cc[o] == 1) No_cc[o] = 0;
                else No_cc[o] = 1;
                // Искажение рандомных битов
                if (No_cc[rand()%len_n] == 1) No_cc[rand()%len_n] = 0;
                else No_cc[rand()%len_n] = 1;

                // Вычисление XOR и остатка от деления
                for(int i=0; i < len_n-G_LEN+1; i++){
                    if(No_cc[i] == 1){
                        for(int j=0; j < G_LEN; j++)
                        No_cc[i+j] ^= G[j];
                    }
                }
                // Проверка на ошибки
                for(int i = len_n-G_LEN+1; i<len_n; i++){
                    if(No_cc[i] == 1) break;
                    if((i == len_n-1) & (No_cc[i] == 0)) k++;
                }
            }
            // if (len_n == 100){
            //     printf("k=%d ", k);
            // }
            //printf("k=%d ", k);
            kk += k;
        }
        double err = (double)kk/(double)(len_n*50);
        sred_error += err;
        count_err ++;
        fflush(stdout);
        //printf("N_LEN = %d | err = %f\n", len_n, err);
        printf("%f, ", err);
        //printf("%f", sred_error/count_err);
    }
    printf("\n Сред знач - %f", sred_error/count_err);
    return 0;
}

import pandas as pd
import matplotlib.pyplot as plt
import numpy as np

class Person:
    def __init__(self, name, city, salary):
        self.name = name
        self.city = city
        self.salary = salary

class PersonBuilder:
    def __init__(self):
        self.name = None
        self.city = None
        self.salary = None

    def set_name(self, name):
        self.name = name
        return self

    def set_city(self, city):
        self.city = city
        return self

    def set_salary(self, salary):
        self.salary = salary
        return self

    def build(self):
        return Person(self.name, self.city, self.salary)


def read_user_base(filename):

    data = pd.read_excel(filename)
    people = []
    for index, row in data.iterrows():

        adress = str(row['Адрес']).split()

        if adress[0] == "г." and adress[2] == "ул.":

            city = adress[1]
        
        else:

            city = adress[1] + " " + adress[2]

        person = PersonBuilder().set_name(row['Имя']).set_city(city).set_salary(row['Зп, руб']).build()
        people.append(person)

    return people

# Task 1
def count_people_in_city(people):
    city_counts = {}
    for person in people:
        if person.city in city_counts:
            city_counts[person.city] += 1
        else:
            city_counts[person.city] = 1
    return city_counts

# Task 2
def average_salary_in_city(people):
    city_salaries = {}
    for person in people:
        if person.city in city_salaries:
            city_salaries[person.city].append(person.salary)
        else:
            city_salaries[person.city] = [person.salary]
    for city, salaries in city_salaries.items():
        city_salaries[city] = np.mean(salaries)
    return city_salaries

# Task 3
def plot_people_in_city_histogram(city_counts):
    cities = list(city_counts.keys())
    counts = list(city_counts.values())
    plt.bar(cities, counts)
    plt.xlabel('Город')
    plt.ylabel('Количество людей')
    plt.title('Количество людей в каждом городе')
    plt.show()


# Task 4
def plot_average_salary_bar_chart(city_salaries):
    cities = list(city_salaries.keys())
    salaries = list(city_salaries.values())
    plt.bar(cities, salaries)
    plt.xlabel('Город')
    plt.ylabel('Средняя зарплата')
    plt.title('Средняя зарплата в каждом городе')
    plt.show()


if __name__ == "__main__":
    people = read_user_base('user_base.xlsx')
    
    city_counts = count_people_in_city(people)
    print("Количество людей в каждом городе:", city_counts)
    
    city_salaries = average_salary_in_city(people)
    print("Средняя зарплата в каждом городе:", city_salaries)
    
    plot_people_in_city_histogram(city_counts)
    
    plot_average_salary_bar_chart(city_salaries)

