using namespace std;

void Merge(int* arr1, int size1, int* arr2, int size2, int* arr3) {
    for (int i = 0; i < size1; i++) {
        *(arr3 + i) = *(arr1 + i);
    }

    for (int i = 0; i < size2; i++) {
        *(arr3 + i + size1) = *(arr2 + i);
    }
}

void Print(int* arr, int size) {
    for (int i = 0; i < size; i++) {
        cout << *(arr + i) << " ";
    }
    cout << endl;
}



