#include <bits/stdc++.h>
using namespace std;

int main(){
 	ifstream fin("flower.in");
	
	int T, N;
	fin >> T >> N;
	
	vector<int> flower;
	for(int i = 0; i<N; i++){
		int a; fin >> a;
		flower.push_back(a);
	}
	
	sort(flower.begin(), flower.end());
	vector<int> neg, pos;
	for(int i = 0; i<N; i++){
		if(flower[i] < 0){
			neg.push_back(flower[i]);
		}
		if(flower[i] > 0){
			pos.push_back(flower[i]);
		}
	}
	sort(neg.begin(), neg.end(), greater<int>());
	int tot_dist = 0;
	int cur_pos = 0;
	int p = 0; int n = 0;
	int ans = 0;
	while(tot_dist <= T){
		//cout << "currrent position: " << cur_pos << ", right: " << pos[p] << ", left: " << neg[n] << endl;
		if(n == neg.size()-1){
			tot_dist += abs(cur_pos - pos[p]);
			cur_pos = pos[p];
			p++;
		}else{
			if(pos[p] < abs(neg[n])){
				tot_dist += abs(cur_pos - pos[p]);
				cur_pos = pos[p];
				p++;
				//cout << "case right closer" << endl;
			}else if(abs(neg[n]) < pos[p]){
				tot_dist += abs(neg[n] - cur_pos);
				cur_pos = neg[n];
				n++;
				//cout << "case left closer" << endl;
			}else{
				if(abs(neg[n]-cur_pos) < abs(pos[p] - cur_pos)){
					tot_dist += abs(neg[n] - cur_pos);
					cur_pos = neg[n];
					n++;
					//cout << "eq: case left closer" << endl;
				}else{
					tot_dist += abs(cur_pos - pos[p]);
					cur_pos = pos[p];
					p++;
					//cout << "eq: case left closer" << endl;
				}
			}
		}
		
		//cout << "tot dist = " << tot_dist << endl;
		if(tot_dist <= T){
			ans++;
		}
	}
	
	cout << ans << endl;
}

