#include <bits/stdc++.h>
using namespace std;

int main(){
	ifstream fin("tree.in");
	int N, B;
	fin >> N >> B;
	
	vector<int> acorn;
	for(int i = 0; i<N; i++){
		int a; fin >> a;
		acorn.push_back(a);
	}
	
	sort(acorn.begin(), acorn.end());
	
	int tot = 0;
	int cnt = 0;
	for(int i = N-1; i>=0; i--){
		tot += acorn[i];
		cnt++;
		if(tot >= B){
			cout << cnt << endl;
			break;
		}
	}
}

