	vector<string> grid;
	for(int i = 0; i<N; i++){
		string a; fin >> a;
		//cout << a << endl;
		grid.push_back(a);
	}
	
	//cout << grid[0][0] << endl;
	vector<pair<int, int>> answer;
	int ans = 0;
	for(int i = 0; i<N; i++){
		for(int j = 0; j<M; j++){
			//horizontal
			if(j<M-2){
				if(grid[i][j] == '.'){
					if(j == 0 || grid[i][j-1] == '#'){
						if(grid[i][j+1] == '.' && grid[i][j+2] == '.'){
							ans++;
							grid[i][j] = '*';
							answer.push_back({i, j});
						}
					}
				}
			}
			//vertical
			if(i<N-2){
				if(grid[i][j] == '.'){
					if(i == 0 || grid[i-1][j] == '#'){
						if(grid[i+1][j] == '.' && grid[i+2][j] == '.'){
							ans++;
							grid[i][j] = '*';
							answer.push_back({i, j});
						}
					}
				}
			}
		}
	}
	cout << ans << endl;
	for(int i = 0; i<answer.size(); i++){
		cout << answer[i].first+1 << " " << answer[i].second+1 << endl;
	}
}

