}

/**

You are given the heads of two sorted linked lists list1 and list2.

Merge the two lists into one sorted list. The list should be made by splicing together the nodes of the first two lists.

Return the head of the merged linked list.

Input: list1 = [1,2,4], list2 = [1,3,4]
Output: [1,1,2,3,4,4]

Example 2:

Input: list1 = [], list2 = []
Output: []

Example 3:

Input: list1 = [], list2 = [0]
Output: [0]



 * Definition for singly-linked list.
 * public class ListNode {
 *     int val;
 *     ListNode next;
 *     ListNode() {}
 *     ListNode(int val) { this.val = val; }
 *     ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */


// this not a streamlined solution
class Solution {
    public ListNode mergeTwoLists(ListNode list1, ListNode list2) {
        if (list1 == null && list2 == null) return null;
        if (list1 == null && list2 != null) return list2;
        if (list2 == null && list1 != null) return list1;

        ListNode resultHead = getMin(list1, list2);
        ListNode curr = resultHead;
        ListNode a = list1;
        ListNode b = list2;

        if (curr == b) b = b.next;
        else a = a.next;

        while (a != null && b != null) {
            ListNode nextSmallest = getMin(a, b);

            if (curr.next == nextSmallest) { // check NPE // they are in the same list
                if (curr.next == b) {
                    b = b.next;
                } else {
                    a = a.next;
                }
            } else { // different list
                if (curr.next == b) {
                    curr.next = a;
                    a = a.next;
                } else {
                    curr.next = b;
                    b = b.next;
                }
            }

            curr = curr.next; // we have set the curr.next as needed
        }

        // handle left over intervals
        if (a == null && b != null) {
            while (b != null) {
                curr.next = b;
                b = b.next;
                curr = curr.next;
            }
        } else if (b == null && a != null) {
           while (a != null) {
                curr.next = a;
                a = a.next;
                curr = curr.next;
            }
        }

        return resultHead;
    }

    private ListNode getMin(ListNode list1, ListNode list2) {
        if (list1.val < list2.val) return list1;
        return list2;
    }
}











// this is a streamlined solution

// This solution also displays the logic you have to keep in mind of covering all the logic flows
// i.e a!=null && b!=null and then, a!=null && b==null and then, a==null && b !=null

class Solution {
    public ListNode mergeTwoLists(ListNode list1, ListNode list2) {
        ListNode a = list1;
        ListNode b = list2;
        ListNode result = null;
        ListNode resultIter = result;

        if (a == null && b != null) return b;
        // if (a == null && b == null) return null;
        if (a != null && b == null) return a;

        // case 1 : when both reach null
        while (a != null && b != null) {
             // Here we decide what the next node is 
            ListNode node = a.val <= b.val ? a : b;
            if (result == null) {
                result = node;
                resultIter = node;
            } else { // the result node ALWAYS moves ahead
                resultIter.next = node;
                resultIter = resultIter.next;
            }

            // Here we decide which node moves ahead
            if (a.val <= b.val) a = a.next;
            else b = b.next;
            
            // basically, the result moves ahead, then a or b moves ahead
        }

        // at this point, both cannot are either null, or one of them is null.
        // simple condition rather than the complicated solve above to capture "One of the lists is not null and the other is null"
        // case 2: when b reaches null
        while (a != null) {
            resultIter.next = a;
            resultIter = resultIter.next;
            a = a.next;
        }

        // case 3: when a reaches null
        while (b != null) {
            resultIter.next = b;
            resultIter = resultIter.next;
            b = b.next;
        }

        return result;
    }
}

const convertCamel = function (varNames) {
  const initial = varNames.trim().toLowerCase();
  const converted = initial.slice(initial.indexOf('_')).replace('_', '');
  const capitalize = converted.replace(
    converted[0],
    converted[0].toUpperCase()
  );

  const camaled = initial.slice(0, initial.indexOf('_')) + capitalize;
  const ticks = '✅'.repeat(converted.length); // Add green ticks based on the length of the converted variable name
  return `${camaled}${ticks}`;
};

